import React from 'react';
import '../styles/ProyectosRecientes.css';

const ProyectosRecientes = () => {
  const proyectos = [
    { nombre: "Proyecto Uno" },
    { nombre: "Proyecto Dos" },
    { nombre: "Proyecto Tres" },
    { nombre: "Proyecto Cuatro" },
    { nombre: "Proyecto Cinco" },
    { nombre: "Proyecto Seis" },
  ];

  return (
    <div className="proyectos-container">
      {/* Zona IA */}
      <aside className="sidebar">
        <h2>Proyectos Recientes</h2>
        <div className="ia-section">
          <div className="ia-card">
            <img src="ruta_a_imagen_tiburon" alt="IA" />
            <p>Inteligencia Artificial (IA)</p>
          </div>
        </div>
      </aside>

      {/* Zona de proyectos */}
      <main className="proyectos-main">
        <div className="proyectos-grid">
          {proyectos.map((proyecto, index) => (
            <div key={index} className="proyecto-card">
              <div className="proyecto-overlay">
                <h3>{proyecto.nombre}</h3>
              </div>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
};

export default ProyectosRecientes;
